import React from "react";
import "./Button.css";

export interface ButtonProps {
	leftIcon: string;
	rightIcon: string;
	// TODO: add icon support
}

class Button extends React.Component {
	render() {
		return (
			<button className="Button" type="button">
				{this.props.children}
			</button>
		);
	}
}

export default Button;
